/**
 * Created by Lenovo on 2019/8/7.
 */
import React from 'react';
import './index.css';
import backBlock from '../image/title/back-block.png';
import {defaultProps} from './defaultProps';
export default class Title extends React.Component {
    static defaultProps = defaultProps;
    constructor(props) {
        super(props);
    }
    onLeftClick() {
        const {onLeftClick} =this.props;
        if (onLeftClick) {
            onLeftClick();
        }
    }
    render() {
        const {title, isHome} =this.props;
        if (isHome) {
            return (
                <div className="title-fill">
                    <div className="title-box-home"><span className="cm-fw-bold">{title}</span></div>
                </div>
            )
        } else {
            return (
                <div className="title-fill">
                    <div className="title-box">
                            <img src={backBlock} alt="" className="cm-img-small" onClick={() => this.onLeftClick()}/>
                            <span className="cm-fw-bold">{title}</span>
                            <div className="title-solid"></div>
                    </div>
                </div>
            )
        }
    }
}
